(window.webpackJsonp=window.webpackJsonp||[]).push([[162],{678:function(e,s,n){"use strict";n.r(s);var a=n(0);const t={class:"content element-doc"},o=Object(a.createStaticVNode)('<h2 id="demarrer"><a class="header-anchor" href="#demarrer">¶</a> Démarrer</h2><p>Cette page vous guidera tout le long de l&#39;installation d&#39;Element Plus au sein d&#39;un projet webpack.</p><h3 id="use-vue-cli-4.5"><a class="header-anchor" href="#use-vue-cli-4.5">¶</a> Use vue-cli@4.5</h3><p>Nous fournissons un <a href="https://github.com/element-plus/vue-cli-plugin-element-plus">plugin Element</a> pour vue-cli@4.5, que vous pouvez utiliser pour créer rapidement un projet basé sur Element.</p><h3 id="utiliser-le-starter-kit"><a class="header-anchor" href="#utiliser-le-starter-kit">¶</a> Utiliser le Starter Kit</h3><p>Nous fournissons un <a href="https://github.com/element-plus/element-plus-starter">template de projet</a> pour débuter rapidement, and also a Vite <a href="https://github.com/element-plus/element-plus-vite-starter">template</a>. Pour les utilisateurs Laravel, il est aussi possible d&#39;utiliser ce <a href="https://github.com/element-plus/element-plus-in-laravel-starter">template</a>. VOus pouvez les télécharger directement.</p><p>Si vous préférer vous passer de template, voyez la section suivante.</p><h3 id="importer-element-plus"><a class="header-anchor" href="#importer-element-plus">¶</a> Importer Element Plus</h3><p>Element Plus peut être importé entièrement ou à la demande. Commençons par l&#39;import total.</p><h4 id="import-total"><a class="header-anchor" href="#import-total">¶</a> Import total</h4><p>Dans main.js:</p><pre><code class="hljs language-javascript"><span class="hljs-keyword">import</span> { createApp, Vue } <span class="hljs-keyword">from</span> <span class="hljs-string">&#39;vue&#39;</span>\n<span class="hljs-keyword">import</span> ElementPlus <span class="hljs-keyword">from</span> <span class="hljs-string">&#39;element-plus&#39;</span>;\n<span class="hljs-keyword">import</span> <span class="hljs-string">&#39;element-plus/lib/theme-chalk/index.css&#39;</span>;\n<span class="hljs-keyword">import</span> App <span class="hljs-keyword">from</span> <span class="hljs-string">&#39;./App.vue&#39;</span>;\n\n<span class="hljs-keyword">const</span> app = createApp(App)\napp.use(ElementPlus)\napp.mount(<span class="hljs-string">&#39;#app&#39;</span>)\n</code></pre><p>L&#39;exemple ci-dessus importe Element Plus entièrement. Notez que les fichiers CSS doivent être importés séparément.</p><h4 id="a-la-demande"><a class="header-anchor" href="#a-la-demande">¶</a> À la demande</h4><p>Grâce au <a href="https://github.com/QingWei-Li/babel-plugin-component">babel-plugin-component</a>, nous pouvons importer uniquement les composants désirés, rendant ainsi le projet plus léger.</p><p>Tout d&#39;abord, installez babel-plugin-component:</p><pre><code class="hljs language-bash">npm install babel-plugin-component -D\n</code></pre><p>Puis éditez .babelrc:</p><pre><code class="hljs language-json">{\n  <span class="hljs-attr">&quot;presets&quot;</span>: [[<span class="hljs-string">&quot;es2015&quot;</span>, { <span class="hljs-attr">&quot;modules&quot;</span>: <span class="hljs-literal">false</span> }]],\n  <span class="hljs-attr">&quot;plugins&quot;</span>: [\n    [\n      <span class="hljs-string">&quot;component&quot;</span>,\n      {\n        <span class="hljs-attr">&quot;libraryName&quot;</span>: <span class="hljs-string">&quot;element-plus&quot;</span>,\n        <span class="hljs-attr">&quot;styleLibraryName&quot;</span>: <span class="hljs-string">&quot;theme-chalk&quot;</span>\n      }\n    ]\n  ]\n}\n</code></pre><p>Ensuite, si vous n&#39;avez besoin que de Button et Select, éditez main.js comme suit:</p><pre><code class="hljs language-javascript"><span class="hljs-keyword">import</span> Vue <span class="hljs-keyword">from</span> <span class="hljs-string">&#39;vue&#39;</span>;\n<span class="hljs-keyword">import</span> { Button, Select } <span class="hljs-keyword">from</span> <span class="hljs-string">&#39;element-plus&#39;</span>;\n<span class="hljs-keyword">import</span> App <span class="hljs-keyword">from</span> <span class="hljs-string">&#39;./App.vue&#39;</span>;\n\nVue.component(Button.name, Button);\nVue.component(Select.name, Select);\n<span class="hljs-comment">/* ou\n * Vue.use(Button)\n * Vue.use(Select)\n */</span>\n\n<span class="hljs-keyword">new</span> Vue({\n  <span class="hljs-attr">el</span>: <span class="hljs-string">&#39;#app&#39;</span>,\n  <span class="hljs-attr">render</span>: <span class="hljs-function"><span class="hljs-params">h</span> =&gt;</span> h(App)\n});\n</code></pre><p>Exemple complet (liste complète des composants dans <a href="https://github.com/ElemeFE/element/blob/master/components.json">components.json</a>):</p><pre><code class="hljs language-javascript"><span class="hljs-keyword">import</span> Vue <span class="hljs-keyword">from</span> <span class="hljs-string">&#39;vue&#39;</span>;\n<span class="hljs-keyword">import</span> {\n  Pagination,\n  Dialog,\n  Autocomplete,\n  Dropdown,\n  DropdownMenu,\n  DropdownItem,\n  Menu,\n  Submenu,\n  MenuItem,\n  MenuItemGroup,\n  Input,\n  InputNumber,\n  Radio,\n  RadioGroup,\n  RadioButton,\n  Checkbox,\n  CheckboxButton,\n  CheckboxGroup,\n  Switch,\n  Select,\n  Option,\n  OptionGroup,\n  Button,\n  ButtonGroup,\n  Table,\n  TableColumn,\n  DatePicker,\n  TimeSelect,\n  TimePicker,\n  Popover,\n  Tooltip,\n  Breadcrumb,\n  BreadcrumbItem,\n  Form,\n  FormItem,\n  Tabs,\n  TabPane,\n  Tag,\n  Tree,\n  Alert,\n  Slider,\n  Icon,\n  Row,\n  Col,\n  Upload,\n  Progress,\n  Spinner,\n  Badge,\n  Card,\n  Rate,\n  Steps,\n  Step,\n  Carousel,\n  CarouselItem,\n  Collapse,\n  CollapseItem,\n  Cascader,\n  ColorPicker,\n  Transfer,\n  Container,\n  Header,\n  Aside,\n  Main,\n  Footer,\n  Timeline,\n  TimelineItem,\n  Link,\n  Divider,\n  Image,\n  Calendar,\n  Backtop,\n  PageHeader,\n  CascaderPanel,\n  Loading,\n  MessageBox,\n  Message,\n  Notification\n} <span class="hljs-keyword">from</span> <span class="hljs-string">&#39;element-plus&#39;</span>;\n\nVue.use(Pagination);\nVue.use(Dialog);\nVue.use(Autocomplete);\nVue.use(Dropdown);\nVue.use(DropdownMenu);\nVue.use(DropdownItem);\nVue.use(Menu);\nVue.use(Submenu);\nVue.use(MenuItem);\nVue.use(MenuItemGroup);\nVue.use(Input);\nVue.use(InputNumber);\nVue.use(Radio);\nVue.use(RadioGroup);\nVue.use(RadioButton);\nVue.use(Checkbox);\nVue.use(CheckboxButton);\nVue.use(CheckboxGroup);\nVue.use(Switch);\nVue.use(Select);\nVue.use(Option);\nVue.use(OptionGroup);\nVue.use(Button);\nVue.use(ButtonGroup);\nVue.use(Table);\nVue.use(TableColumn);\nVue.use(DatePicker);\nVue.use(TimeSelect);\nVue.use(TimePicker);\nVue.use(Popover);\nVue.use(Tooltip);\nVue.use(Breadcrumb);\nVue.use(BreadcrumbItem);\nVue.use(Form);\nVue.use(FormItem);\nVue.use(Tabs);\nVue.use(TabPane);\nVue.use(Tag);\nVue.use(Tree);\nVue.use(Alert);\nVue.use(Slider);\nVue.use(Icon);\nVue.use(Row);\nVue.use(Col);\nVue.use(Upload);\nVue.use(Progress);\nVue.use(Spinner);\nVue.use(Badge);\nVue.use(Card);\nVue.use(Rate);\nVue.use(Steps);\nVue.use(Step);\nVue.use(Carousel);\nVue.use(CarouselItem);\nVue.use(Collapse);\nVue.use(CollapseItem);\nVue.use(Cascader);\nVue.use(ColorPicker);\nVue.use(Transfer);\nVue.use(Container);\nVue.use(Header);\nVue.use(Aside);\nVue.use(Main);\nVue.use(Footer);\nVue.use(Timeline);\nVue.use(TimelineItem);\nVue.use(Link);\nVue.use(Divider);\nVue.use(Image);\nVue.use(Calendar);\nVue.use(Backtop);\nVue.use(PageHeader);\nVue.use(CascaderPanel);\n\nVue.use(Loading.directive);\n\nVue.prototype.$loading = Loading.service;\nVue.prototype.$msgbox = MessageBox;\nVue.prototype.$alert = MessageBox.alert;\nVue.prototype.$confirm = MessageBox.confirm;\nVue.prototype.$prompt = MessageBox.prompt;\nVue.prototype.$notify = Notification;\nVue.prototype.$message = Message;\n</code></pre><h3 id="configuration-globale"><a class="header-anchor" href="#configuration-globale">¶</a> Configuration globale</h3><p>Lors de l&#39;import d&#39;Element, vous pouvez définir un objet de configuration global. Actuellement il possède de propriétés: <code>size</code> et <code>zIndex</code>. La propriété <code>size</code> détermine la taille par défaut de tout les composants et <code>zIndex</code> règle le z-index initial (default: 2000) des fenêtres modales:</p><p>Import total d&#39;Element：</p><pre><code class="hljs language-js"><span class="hljs-keyword">import</span> Vue <span class="hljs-keyword">from</span> <span class="hljs-string">&#39;vue&#39;</span>;\n<span class="hljs-keyword">import</span> ElementPlus <span class="hljs-keyword">from</span> <span class="hljs-string">&#39;element-plus&#39;</span>;\nVue.use(Element, { <span class="hljs-attr">size</span>: <span class="hljs-string">&#39;small&#39;</span>, <span class="hljs-attr">zIndex</span>: <span class="hljs-number">3000</span> });\n</code></pre><p>Import partiel d&#39;Element：</p><pre><code class="hljs language-js"><span class="hljs-keyword">import</span> Vue <span class="hljs-keyword">from</span> <span class="hljs-string">&#39;vue&#39;</span>;\n<span class="hljs-keyword">import</span> { Button } <span class="hljs-keyword">from</span> <span class="hljs-string">&#39;element-plus&#39;</span>;\n\nVue.prototype.$ELEMENT = { <span class="hljs-attr">size</span>: <span class="hljs-string">&#39;small&#39;</span>, <span class="hljs-attr">zIndex</span>: <span class="hljs-number">3000</span> };\nVue.use(Button);\n</code></pre><p>Avec la configuration ci-dessus, la taille par défaut des composants ayant l&#39;attribut size sera &#39;small&#39;, et le z-index initial des fenêtres modales est 3000.</p><h3 id="commencer-a-developper"><a class="header-anchor" href="#commencer-a-developper">¶</a> Commencer à développer</h3><p>Maintenant que vous avez ajouté Vue et Element Plus à votre projet, vous pouvez commencer à coder. Référez-vous à la documentation de chaque composant pour savoir comment les utiliser.</p><h3 id="utiliser-nuxt.js"><a class="header-anchor" href="#utiliser-nuxt.js">¶</a> Utiliser Nuxt.js</h3><p>Vous pouvez également commencer un projet avec <a href="https://nuxtjs.org/">Nuxt.js</a>:</p><div class="glitch-embed-wrap" style="height:420px;width:100%;"><iframe src="https://glitch.com/embed/#!/embed/nuxt-with-element?path=nuxt.config.js&amp;previewSize=0&amp;attributionHidden=true" alt="nuxt-with-element on glitch" style="height:100%;width:100%;border:0;"></iframe></div>',35);const l={render:function(e,s,n,l,p,u){return Object(a.openBlock)(),Object(a.createBlock)("section",t,[o])}};s.default=l}}]);